frame_eqs_eel:
wave_x = wave_x + 0.150*(0.60*sin(2.121*time) + 0.40*cos(1.621*time));
wave_y = wave_y - 0.150*(0.60*sin(1.742*time) + 0.40*sin(2.322*time));
wave_r = wave_r + 0.5*(0.40*sin(0.823*time) + 0.20*sin(0.916*time));
wave_g = wave_g - 0.5*(0.40*sin(0.900*time) - 0.20*sin(1.023*time));
wave_b = wave_b - 0.5*(0.40*sin(0.808*time) - 0.20*sin(0.949*time));
decay = 0.98 + 0.002*sin(time);
wave_r = wave_r+above(sin(0.2*time),0.33)*if (below(wave_r,0.5),0.5,wave_r);
wave_g = wave_g + below(sin(0.2*time),0.33)*above(sin(0.2*time),-0.33)*if(below(wave_g,0.5),0.5,wave_g);
wave_b = wave_b+below(sin(0.2*time),-0.33)*if(below(wave_b,0.5),0.5,wave_b);

pixel_eqs_eel:
zoom = zoom + 0.02*bass + 0.01*sin(1-0.2*rad);
